import React, {Component} from "react";
import '../css/GettingStarted.'

class GettingStarted extends Component{
    render(){
        return(
        <div className="gs container-fluid">
            <p className="gsHead">Getting started with<br/>Foresight App</p>
        </div>
        );
    }
}

export default GettingStarted;
